                    hStock.stockadicionado = CCP.updatestock.Value;
                }
                hStock.stockfinal = CCP.stock.Value;
                hStock.datacriacao = DateTime.Now.ToShortDateString();
                hStockC.Post(hStock);
                hStock = new HistoricoStock();

                var resultado = CAPC.Post(CCP);
                await Task.Delay(1000);
